import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function LaunchCard({launchItem}) {
  return (
    <Card style={{ minWidth: '18rem' }}>
      <div style={{height:'400px', overflowY:'hidden'}}><Card.Img variant="top" src={launchItem.links.flickr.original[0]} /></div>
      <Card.Body>
        <Card.Title>{launchItem.name}</Card.Title>
        {/* <Card.Text>
          {launchItem.details}
        </Card.Text> */}
        <Button href={launchItem.links.webcast} target="_blank" variant="primary">Webcast Link</Button>
      </Card.Body>
    </Card>
  );
}

export default LaunchCard;
